import Link from 'next/link';

import styled from 'styled-components'

const Container = styled.div`
  height: 40px;
  display: flex;
  align-items: center;
  justify-content: flex-end;
`
const A = styled.a`
  margin: 10px 20px;
  text-transform: uppercase;
`
const Header = () => (
    <Container>
      <Link href="/">
        <A>home</A>
      </Link>
      <Link href="/releases">
        <A>releases</A>
      </Link>
      <Link href="/contact">
        <A>Contact</A>
      </Link>
    </Container>
  );

  export default Header;
